let OnClickHandler = (props) => {


    return (

        <div id={props.id} onClick={() => this.props.clickChar([props.clickChar])}>

        <img src={props.src} alt="Pic" />
        <h2>{props.Name}</h2> 
     </div> 
        )
    }

export default OnClickHandler;
